import { useState, useEffect } from 'react'
import UserSidebar from '../components/UserSidebar'
import workoutServices from '../services/workouts'
import exerciseServices from '../services/exercises'
import './WorkoutHistoryPage.css'

import maleHumanBodyImage from '../maleHumanBodyImage.png'
import maleHumanBodyMap from '../maleHumanBody.map'

const WorkoutHistoryPage = ({setLoggedIn}) => {

    const [openDropdown, setOpenDropdown] = useState(false)
    const [prevWorkouts, setPrevWorkouts] = useState([])
    const [selectedWorkout, setSelectedWorkout] = useState(null)

    const handleDropdownClick = () => {
	setOpenDropdown(!openDropdown)
	workoutServices.get().then(userWorkouts => {		
	    console.log(`dropdown userWorkouts`)
	    setPrevWorkouts(userWorkouts)
	    setSelectedWorkout(userWorkouts.at('0'))
	})
	console.log(prevWorkouts)	    
    }

    const handleSelectedWorkoutChange = (event) => {
	console.log(`event ${event.target.value}`)
	setSelectedWorkout(prevWorkouts.at(event.target.value.toString()))
    }

    const Dropdown = ({open, trigger}) => {
	return (
	        <>
		    {trigger}
	            {open ? (
		    <ul>
			<select name="previous-workouts" id="previous-workouts" value={selectedWorkout} onChange={handleSelectedWorkoutChange}>
			    {prevWorkouts.map((workout, index) =>
				    <option value={index} selected={ () => {
					const match = selectedWorkout.createdAt === workout.createdAt
					console.log(match)
					return match.toString()}}> {workout.createdAt} </option>)}
		        </select>
		    </ul>
	            ) : null}
	        </>
	    )
    }

    const HumanBody = () => {
	const [imageMap, setImageMap] = useState([])

	 useEffect(() => {
	     fetch(maleHumanBodyMap)
		 .then((response) => response.text())
		 .then((mapData) => {
		     const mapJson = convertMapFileToJson(mapData);
		     setImageMap(mapJson);
		 })
		 .catch((error) => {
		     console.error('Error loading map file:', error);
		 });
	 }, []);


	 const convertMapFileToJson = (mapData) => {
	     const shapeRegex = /<area[^>]+>/g;
	     const coordsRegex = /coords="([^"]+)"/;
	     const hrefRegex = /href="([^"]+)"/;

	     const shapes = mapData.match(shapeRegex);
	     const imageMapData = shapes.map((shape) => {
		 const coordsMatch = shape.match(coordsRegex);
		 const hrefMatch = shape.match(hrefRegex);

		 const coords = coordsMatch ? coordsMatch[1].split(',') : [];
		 const href = hrefMatch ? hrefMatch[1] : '';

		 return {
		     shape: 'poly', // Specify the shape type here (rect, circle, poly, etc.)
		     coords: coords.map(Number),
		     href,
		 };
	     });

	     return imageMapData;
	 };


	return (
		<div className="image-container">
		<div className="image-wrapper">
		    <img src={maleHumanBodyImage} alt="Male Human Body"/>
		</div>
		<svg className="highlight" viewBox="0 0 500 500"
	    style={{		
		top: '240px',
		left: '350px',
		width: '110px',
		height: '90px'
	    }}
		>
		<polygon
	    points="5,355 250,250 475,100 465,365 325,425"
	    fill="red"
	    stroke="red"
	    strokeWidth="2"
	    />	    
	    </svg>
	</div>
	)
    }

    return (
	    <div className="wh-main">
	    <UserSidebar setLoggedIn={setLoggedIn}/>	    	    
	    <div className="prev-workouts">
	    <Dropdown
	        open={openDropdown}
	        trigger={<button onClick={handleDropdownClick}> Previous Workouts </button>}
	    />
	    {selectedWorkout === null ? <label> Choose a workout  </label> :
	     <ul>
	     <li className="labels">
	     <span className="label"> Exercise </span>
	     <span className="label"> Sets </span>
	     <span className="label"> Reps </span>
	     </li>
	     {selectedWorkout.clusters.map(cluster =>
		     <li className="labels">
		     <span className="label"> {cluster.exercise.name} </span>
		     <span className="label"> {cluster.sets} </span>
		     <span className="label"> {cluster.reps} </span>
		     </li>
	     )
	     }
	     </ul>
	     }

	</div>
	    <div className="human-body">
	    <HumanBody />
	    </div>
	</div>
	   )
}

export default WorkoutHistoryPage
